import { combineReducers, configureStore } from '@reduxjs/toolkit'
import jobReducer from '../reducers/JobSearch'

const finalReducer=combineReducers({
  jobs:jobReducer
})
const store = configureStore({
  reducer: finalReducer,
})

export default store
